import React, { Component } from 'react';
import Blog from './Blog';
import PropTypes from 'prop-types';

class Blogs extends Component {
  render() {
    return this.props.blogs.map((blog) => (
      <Blog key={blog.id} blog={blog} />
    ));
  }
}

// PropTypes
Blogs.propTypes = {
}

export default Blogs;
